def count_good_team_names(test_cases):
    results = []
    for test in test_cases:
        (N, words) = test
        d = {}
        for word in words:
            suffix = word[1:]
            if suffix not in d:
                d[suffix] = set()
            d[suffix].add(word[0])
        tlist = list(d.keys())
        n1 = len(tlist)
        ans = 1
        for i in range(n1):
            for j in range(i + 1, n1):
                total = d[tlist[i]].union(d[tlist[j]])
                ans += len(total.difference(d[tlist[j]])) * len(total.difference(d[tlist[i]]))
        results.append(ans * 2)
    return results

